import React from "react";
import "./CustomNav.scss";

const CustomNav = () => {
  const showMobileNav = () => {
    document.getElementById("nav-body").style.marginTop = "0px";
  };

  return (
    <div className="custom-nav">
      <nav>
        <div className="icon" onClick={this.showMobileNav}>
          <div className="hamburger" />
        </div>
        <ul id="nav-body">
          <li className="active">
            <a href="#home">Home</a>
          </li>
          <li>
            <a href="#news">News</a>
          </li>
          <li>
            <a href="#contact">Contact</a>
          </li>
          <li>
            <a href="#about">About</a>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default CustomNav;
